BEGIN TRANSACTION;
CREATE TABLE sessions (id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, start_time STRING NOT NULL, server_time_offset DOUBLE, last_event_time STRING, pause_time STRING NOT NULL, locale STRING NOT NULL, event_seq INTEGER NOT NULL DEFAULT 0, api_key STRING NOT NULL, type INTEGER NOT NULL, app_state STRING, finished BOOL NOT NULL DEFAULT 0, session_id STRING NOT NULL, attribution_id STRING);
CREATE TABLE kv (k STRING NOT NULL PRIMARY KEY, v STRING NOT NULL DEFAULT '');
CREATE TABLE events (id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, created_at STRING NOT NULL, session_id INTEGER NOT NULL, seq INTEGER NOT NULL, offset STRING NOT NULL, name STRING, value STRING, type INTEGER NOT NULL, latitude DOUBLE, longitude DOUBLE, location_timestamp STRING, location_horizontal_accuracy INTEGER, location_vertical_accuracy INTEGER, location_direction INTEGER, location_speed INTEGER, location_altitude INTEGER, location_enabled INTEGER DEFAULT -1, error_environment STRING, app_environment STRING, user_info STRING, bytes_truncated INTEGER, user_profile_id STRING, encryption_type INTEGER NOT NULL, first_occurrence INTEGER DEFAULT -1);
CREATE INDEX events_session_id ON events (session_id);
CREATE INDEX events_created_at ON events (created_at ASC);
COMMIT;
